/*Table structure for table `actividad_economica_ofertante` */

DROP TABLE IF EXISTS `actividad_economica_ofertante`;

CREATE TABLE `actividad_economica_ofertante` (
  `id_actividad_econimica_ofertante` int(11) NOT NULL AUTO_INCREMENT,
  `id_actividad_econimica` int(11) NOT NULL,
  `id_ofertante` int(11) NOT NULL,
  `estado` enum('A','I') COLLATE utf8mb4_spanish_ci NOT NULL DEFAULT 'A',
  PRIMARY KEY (`id_actividad_econimica_ofertante`),
  KEY `actividad_ecnomica_` (`id_actividad_econimica`),
  KEY `ofertante__` (`id_ofertante`),
  CONSTRAINT `actividad_ecnomica_` FOREIGN KEY (`id_actividad_econimica`) REFERENCES `actividad_economica` (`id_actividad_economica`) ON UPDATE CASCADE,
  CONSTRAINT `ofertante__` FOREIGN KEY (`id_ofertante`) REFERENCES `ofertante` (`id_ofertante`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish_ci;

