/*Table structure for table `educacion_ofertante` */

DROP TABLE IF EXISTS `educacion_ofertante`;

CREATE TABLE `educacion_ofertante` (
  `id_educacion_profesion` int(11) NOT NULL AUTO_INCREMENT,
  `id_ofertante` int(11) NOT NULL,
  `id_profesion` int(11) NOT NULL,
  `estado` enum('A','I') COLLATE utf8mb4_spanish_ci NOT NULL DEFAULT 'A',
  PRIMARY KEY (`id_educacion_profesion`),
  KEY `ofertante-1` (`id_ofertante`),
  KEY `profesion` (`id_profesion`),
