/*Table structure for table `persona` */

DROP TABLE IF EXISTS `persona`;

CREATE TABLE `persona` (
  `id_persona` int(11) NOT NULL AUTO_INCREMENT,
  `id_documento` int(11) NOT NULL,
  `identificacion` int(11) NOT NULL,
  `primer_nombre` varchar(30) COLLATE utf8mb4_spanish_ci NOT NULL,
  `otros_nombre` varchar(30) COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `primer_apellido` varchar(30) COLLATE utf8mb4_spanish_ci NOT NULL,
  `otros_apellido` varchar(30) COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `genero` enum('M','F','O') COLLATE utf8mb4_spanish_ci NOT NULL,
  `fecha_nacimiento` date NOT NULL,
  `fecha_expedicion` date NOT NULL,
  `id_ubicacion` int(11) NOT NULL,
  `estado` enum('A','I') COLLATE utf8mb4_spanish_ci NOT NULL DEFAULT 'A',
  PRIMARY KEY (`id_persona`),
  KEY `ubicacion` (`id_ubicacion`),
  KEY `persona_tipo_documento` (`id_documento`),
  CONSTRAINT `persona_tipo_documento` FOREIGN KEY (`id_documento`) REFERENCES `tipo_documento` (`id_documento`),
  CONSTRAINT `ubicacion` FOREIGN KEY (`id_ubicacion`) REFERENCES `ubicacion` (`id_ubicacion`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish_ci;

