/* Procedure structure for procedure `create_per` */

/*!50003 DROP PROCEDURE IF EXISTS  `create_per` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `create_per`(IN `id_per` INT, `id_docu` INT, `identifi` INT, `prinombre` VARCHAR(30), `otronom` VARCHAR(30), `priapellido` VARCHAR(30), `otroapellido` VARCHAR(30), `gener` ENUM('M','F','O'), `fechnacimiento` DATE, `fechexped` DATE, `id_ubi` INT, `est` ENUM('A','I'), `correo` VARCHAR(200), `passwd` VARCHAR(50), `pregunta` VARCHAR(200), `idface` VARCHAR(30), `respuesta` VARCHAR(70), `dir` VARCHAR(100), `barr` VARCHAR(80), `id_muni` INT, `tel` BIGINT, `cel` BIGINT)
BEGIN 
   DECLARE errno INT;
   DECLARE proceso VARCHAR(5);
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
    GET CURRENT DIAGNOSTICS CONDITION 1 errno = MYSQL_ERRNO;
    
    SET @proceso="ERROR";
    SELECT errno AS MYSQL_ERROR,@proceso AS proceso;
    ROLLBACK;
    END;
    START TRANSACTION;
    
CALL create_ubi(1,dir,barr,id_muni,tel,cel,correo,'A');
SELECT LAST_INSERT_ID() INTO @id_ubi;
INSERT INTO persona VALUES(NULL,id_docu,identifi,prinombre,otronom,priapellido,otroapellido,
gener,fechnacimiento,fechexped,@id_ubi,est);
SELECT LAST_INSERT_ID() INTO @id_per;
CALL create_recu(1,pregunta, respuesta);
SELECT LAST_INSERT_ID() INTO @id_recupera;
CALL create_user(1,correo,passwd,"usuario.png",idface,@id_recupera,@id_per,'2','A',CURRENT_TIMESTAMP,"0000-00-00 00:00:00");
CALL create_ofer(1,@id_per,"N/A",'A');
SET @proceso="OK";
SELECT @proceso AS proceso ;
COMMIT WORK;
END */$$
DELIMITER ;

